import React, { Fragment } from 'react'
import ContactItem from './contactItem'

const contact = (props) => {

    const {persons} = props
    return (
        <div>
            {persons.map((person) => (
                <ContactItem person={person} key={person.id}/>
            ))}
        </div>
    )
}

con.propTypes = {
    persons : PropTypes.array.isRequired
}
